import React from "react";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

// core components
import Header from "components/Header/Header.js";
import HeaderLinks from "components/Header/HeaderLinks.js";

import Gallery from 'react-photo-gallery';

import styles from "assets/jss/material-kit-react/views/loginPage.js";

import image from "assets/img/bg7.jpg";
import g1 from "assets/img/image/gallery/1.webp";
import g2 from "assets/img/image/gallery/2.webp";
import g3 from "assets/img/image/gallery/3.webp";
import g4 from "assets/img/image/gallery/4.webp";
import g5 from "assets/img/image/gallery/5.webp";
import g6 from "assets/img/image/gallery/6.webp";
import g7 from "assets/img/image/gallery/7.webp";
import g8 from "assets/img/image/gallery/8.webp";
import g9 from "assets/img/image/gallery/9.webp";
import g10 from "assets/img/image/gallery/10.webp";
import g11 from "assets/img/image/gallery/11.webp";
import g12 from "assets/img/image/gallery/12.webp";
import g13 from "assets/img/image/gallery/13.webp";
import g14 from "assets/img/image/gallery/14.webp";
import g15 from "assets/img/image/gallery/15.webp";
import g16 from "assets/img/image/gallery/16.webp";
import g17 from "assets/img/image/gallery/17.webp";
import g18 from "assets/img/image/gallery/18.webp";
import g19 from "assets/img/image/gallery/19.webp";
import g20 from "assets/img/image/gallery/20.webp";
import g21 from "assets/img/image/gallery/21.webp";
import g22 from "assets/img/image/gallery/22.webp";


const useStyles = makeStyles(styles);

const photos = [
  {
    src: {g1},
    width: 4,
    height: 3
  },
  {
    src: {g2},
    width: 1,
    height: 1
  }
];


export default function GalleryPage(props) {
  const [cardAnimaton, setCardAnimation] = React.useState("cardHidden");
  setTimeout(function() {
    setCardAnimation("");
  }, 700);
  const classes = useStyles();
  const { ...rest } = props;
  return (
    <div>
      <Header
        absolute
        color="transparent"
        brand="Material Kit React"
        rightLinks={<HeaderLinks />}
        {...rest}
      />
      <div
        className={classes.pageHeader}
        style={{
          backgroundImage: "url(" + image + ")",
          backgroundSize: "cover",
          backgroundPosition: "top center"
        }}
      >
       <Gallery photos={photos}/>
      </div>
    </div>
  );
}
